import { useState } from 'react';

const ShowAvailableSlots = (props) => {
  const id=props.id;
  const [data,setData]=useState([]);
  useEffect(()=>{
    const fetchData = async () => {
      try {
        const response = await fetch(`http://localhost:3001/getDoctorFreeSlotDetails/${id}`);
        const json = await response.json();
        setData(json)
        console.log(data);
      } catch (error) {
        console.error(error);
      }
    };
    fetchData();

  },[])

  return (
    <div>
      These are the available slots list
      <ul>
        {data.map((item) => (
          <li key={item.id}> {item.startTime} -- {item.endTime}
          <button> Book Slot </button>
          </li>
        ))}
      </ul>


    </div>
  )
}

